import React from 'react'
import FeedItem from './feedItem'

let style = {
    overflow: 'scroll'
}

let feedTestRandom = setTimeout(() => {
    return(<FeedItem>ABCDEF</FeedItem>)
}, 3000)

const unregisteredFeed = () => {
    return(
    <div style={style}>
        {feedTestRandom()}
    </div>)
}

export default unregisteredFeed
